From a classic omelet to a quick curry, from one-pot suppers (like Bean Cassoulet) to light soups and salads, this one-stop cookbook has an amazing array of fast, easy, and delicious meals. With a whopping 1001 recipes, there's something to please every palate and for every occasion, whether you're rushing to put supper on the table, barbecuing outdoors, preparing a showstopping feast, or feeding someone who's dieting or gluten-free. You'll also find the ultimate top 10 recipes for cocktails, dips, salsas, sauces, and more, as well as nutritional breakdowns, lifesaving freezer recipes, and instructions for all the basics. With mouthwatering color photographs, this is the ultimate kitchen essential for beginners and experienced cooks alike
